import React from 'react';

import './App.css';

function App() {
  return (
   <div className="wrapper gambar">
     <div className="flex-wrapper">
        <div className="flex-judul">
            <div className="judul">
              <h1>Sekolah</h1>
            </div>  
        </div>
     </div>
   </div>
  );
}

export default App;
